INSERT INTO `his_config_info` VALUES (2, 391, 'process-gateway-dev.yml', 'DEFAULT_GROUP', '', 'spring:\n  redis:\n    host: 47.96.74.120\n    port: 6379\n    password: 12345\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          lowerCaseServiceId: true\n          enabled: true\n      routes:\n        # 认证中心\n        - id: process-auth\n          uri: lb://process-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n           # - CacheRequestFilter\n          # - ValidateCodeFilter\n            - StripPrefix=1\n        # 流程中心\n        - id: process-center\n          uri: lb://process-center\n          predicates:\n            - Path=/processCenter/**\n          filters:\n            - StripPrefix=1\n        # 代码生成\n        - id: process-gen\n          uri: lb://process-gen\n          predicates:\n            - Path=/code/**\n          filters:\n            - StripPrefix=1\n         # 流程中心\n        - id: process-manager\n          uri: lb://process-manager\n          predicates:\n            - Path=/processmanager/**\n          filters:\n            - StripPrefix=1\n        # 定时任务\n        - id: process-job\n          uri: lb://process-job\n          predicates:\n            - Path=/schedule/**\n          filters:\n            - StripPrefix=1\n        # 系统模块\n        - id: process-system\n          uri: lb://process-system\n          predicates:\n            - Path=/system/**\n          filters:\n            - StripPrefix=1\n        # 文件服务\n        - id: process-file\n          uri: lb://process-file\n          predicates:\n            - Path=/file/**\n          filters:\n            - StripPrefix=1\n\n# 不校验白名单\nignore:\n  whites:\n    - /auth/logout\n    - /auth/login\n    - /*/v2/api-docs\n    - /csrf\n    - /processCenter/workFlowUsers/selectAll\n    - /processCenter/flowable/task/image/**\n    - /processCenter/auth/**\n', '3b48c898d2a713c3bc3babf436e0a617', '2021-09-09 09:50:23', '2021-09-09 09:50:24', NULL, '127.0.0.1', 'U', '');
